import React from 'react';
//import './EnterpriseTechnologyModal.css';

export default function EnterpriseTechnologyModal({category})
{
	var modalContent = '';

	if (category == 'test')
	{
		modalContent = 'testSuccess';
	}
	return (

		<div>
			<h1>{modalContent}</h1>
		</div>

	);
}
